      <div className="home">
        <form onSubmit={e => e.preventDefault()}>
            <h1>Username: </h1>
            <input type="text"/>
            <h1>Password: </h1>
            <input type="password"/>
            <input type="submit" value='Log In' />
        </form>
        <img
          src="https://marketplace.canva.com/MADGyYVoY2c/4/screen/canva-aerial-photography-of-cityscape-MADGyYVoY2c.jpg"
          alt="placeholder"
        />


      </div>

    );
  }
}

export default Home;
